define({"topics":[{"title":"Choose who can see when you are online","shortdesc":"<p class=\"shortdesc\">Individuals on this privacy list can see your status, or are excluded from seeing         your status, when you are online. If you set this privacy list so that someone cannot see         you when you are online, you do not see them when they are online either. <\/p>","href":"t_st9_privacy_online.html","attributes":{"data-id":"t_privacy_online"},"menu":{"hasChildren":false},"tocID":"t_privacy_online-d433e285","topics":[]},{"title":"Choose who can chat with you when your status is set to Do Not Disturb","shortdesc":"<p class=\"shortdesc\">You can create a list of specific people who can see your status as Available, even when your status is Do Not Disturb.<\/p>","href":"t_st9_privacy_dnd.html","attributes":{"data-id":"t_st9_privacy_dnd"},"menu":{"hasChildren":false},"tocID":"t_st9_privacy_dnd-d433e296","topics":[]},{"title":"Allow members of external communities to contact you","shortdesc":"<p class=\"shortdesc\">If you have access to external server communities, members of those communities might need to grant you permission before you can add them to your contact list. You might also need to grant permission to them before they can add you to their contact lists. After permission is granted, your status displays for them and you can chat with each other.<\/p>","href":"t_st9_privacy_externalcomm.html","attributes":{"data-id":"t_st9_privacy_externalcomm"},"menu":{"hasChildren":false},"tocID":"t_st9_privacy_externalcomm-d433e307","topics":[]}]});